Nature Documentary hosted by Richard Hammond and Julia Bradbury, published by BBC broadcasted as part of BBC Planet Earth Live series in 2012 - English narration


Information
------------------------------

Episode 5 Samburu: Kenya, Kalahari Desert: Update
The global live wildlife event continues, as the teams present the latest news on all the animal stars. In Kenya, Richard has more news on the vulnerable lion cubs and the newborn elephant calf. In the woods in North America, Julia is with the bear cubs and has an update from California on the migrating gray whale mothers and calves. Also, there are reports on the monkeys and those charming meerkats.

